  [],\n\t\"revision_timestamp\": \"2015-05-07T01:01:05.003559\",\n\t\"name\": \"novel-liquid-membranes-for-co2-and-h20-control-in-eva-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The development of new, robust, lightweight
  systems for CO2 removal during EVA is a crucial need for NASA.  With current activity
  focused on the development of Lunar outposts, mission times will need to be extended
  without increasing the size and weight of the portable life support system (PLSS).
  \ While much of the recent work on the development of new CO2 control strategies
  has centered on sorbents that can be regenerated during the mission, these system
  add \"on back\" hardware, increasing weight and complexity, and reducing reliability.
  \ rnrnA simpler approach is to use a membrane system to separate CO2 and H2O from
  the O2 environment.  Unfortunately, separating gas phase molecules with the needed
  selectivity is difficult with standard membrane materials.  However, converting
  CO2 and H2O to compounds with much different properties, could allow the needed
  separation to be achieved.  Therefore in this Phase I project, Reaction Systems
  will develop a liquid membrane that will have high permeance and selectivity for
  CO2 and H2O compared to O2, resulting in a TRL = 4.  In Phase II we will advance
  the TRL to 6 by designing and constructing a full scale prototype, which will be
  delivered it to NASA.  rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
